import React, { useEffect, useState } from "react";
import { Link, Route, Routes, useNavigate } from "react-router-dom";
import IndicadoresFII from "./IndicadoresFII";
import HistoricoDividendos from "./HistoricoDividendos";
import ExposicaoProjetos from "./ExposicaoProjetos";
import "../../../styles/Life11.css"; // Estilos

const Life11 = () => {
  const [dados, setDados] = useState(null);
  const navigate = useNavigate();

  useEffect(() => {
    // Simulação dos dados extraídos do Excel
    const dadosFII = {
      dataAtualizacao: "12/03/2025",
      pl: 374356700, // Patrimônio Líquido
      quantidadeCotas: 37901307,
      valorCota: 9.877145,
      variacaoCota: 0.003207,
      caixa: 100,
      cnpj: "01.234.567/0001-89",
      administrador: "Vórtx",
      cotaAjustada: 14.877145,
      taxaPerformance: 0.2,
      taxaAdm: 0.0138,
      valorPerformance: 1500000,
      valorAdm: 400000,
    };

    setDados(dadosFII);
  }, []);

  return (
    <div className="life11-container">
      <h2 className="life11-title">Fundos Imobiliários - LIFE11</h2>

      <div className="button-container">
        <button className="tab-button" onClick={() => navigate("/fundos/life11/indicadores")}>Indicadores</button>
        <button className="tab-button" onClick={() => navigate("/fundos/life11/dividendos")}>Histórico de Dividendos</button>
        <button className="tab-button" onClick={() => navigate("/fundos/life11/exposicao")}>Exposição por Projetos</button>
      </div>

      <Routes>
        <Route path="/fundos/life11/indicadores" element={<IndicadoresFII dados={dados} />} />
        <Route path="/fundos/life11/dividendos" element={<HistoricoDividendos />} />
        <Route path="/fundos/life11/exposicao" element={<ExposicaoProjetos />} />
      </Routes>
    </div>
  );
};

export default Life11;
